import { NavLink } from "react-router-dom";
import classes from "./UkrainianNavigation.module.css";
function UkrainianNavigationTop() {
  return (
    <nav className={classes.navigationTop}>
      <NavLink
        className={classes.link}
        activeClassName="selected"
        to="/ukrainian/aboutUs"
      >
        Про нас
      </NavLink>
      <NavLink
        className={classes.link} activeClassName="selected" to="/ukrainian/rooms" >
        Номера та ціни
      </NavLink>
      <NavLink className={classes.link} activeClassName="selected" to="">
        Галерея
      </NavLink>
      <NavLink className={classes.link} activeClassName="selected" to="">
        Контакти
      </NavLink>
    </nav>
  );
}
export default UkrainianNavigationTop;
